export async function getToken(data) {
    const response = fetch('https://localhost:8080/api/users/token', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json'
        },
        body: data
    })
    if (!response.ok) {
        throw new Error("Authorization wasn\'t successfully")
    }
    var res = await response.json()
    return res
}
